import React from 'react';
import Header from './components/header';
import "./styles.css";
import Umidade, {Component} from './pages/main/umidade';
import {
  BarChart,
  Bar,
  Line,
  LineChart,
  XAxis,
  YAxis,
  Tooltip
} from 'recharts';


const App = () => (
  <div className="App">
    <Header/>
    <Umidade />
  </div>
);




export default App;
